import React, { useEffect, useState } from "react";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const [error, setError] = useState("");
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        console.log("Fetching with token:", token);

        const response = await fetch(
          "https://qa-uaesaas-api.instapract.ae/web/api/doctor/doc-list",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
              APPID: "Gem3s12345",
              Authorization: `Bearer ${token}`,
            },
            body: JSON.stringify({}),
          }
        );

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && Array.isArray(data.data)) {
          setDoctors(data.data);
        } else {
          setDoctors([]);
          setError(data.message || "No doctors found.");
        }
      } catch (err) {
        console.error("Error fetching doctor list:", err);
        setError("Failed to fetch doctor list.");
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      setError("You must log in first.");
    }
  }, [token]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>
      {error && <p className="text-red-500 mb-4">{error}</p>}

      {doctors.length === 0 && !error ? (
        <p className="text-gray-500">No doctors found.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white border border-gray-200 rounded-lg shadow">
            <thead className="bg-gray-100">
              <tr>
                <th className="py-3 px-4 text-left border-b">Image</th>
                <th className="py-3 px-4 text-left border-b">Name</th>
                <th className="py-3 px-4 text-left border-b">Specialty</th>
              </tr>
            </thead>
            <tbody>
              {doctors.map((doc, index) => {
                const name = doc.name || doc.doctor_name || doc.full_name || "No Name";
                const profilePic = doc.profile_pic || "https://via.placeholder.com/50";
                const specialties =
                  Array.isArray(doc.specialty) && doc.specialty.length > 0
                    ? doc.specialty.map((s) => s.name).join(", ")
                    : "No Specialty";

                return (
                  <tr key={index} className="border-b hover:bg-gray-50">
                    <td className="py-2 px-4">
                      <img
                        src={profilePic}
                        alt={name}
                        className="w-12 h-12 rounded-full object-cover"
                      />
                    </td>
                    <td className="py-2 px-4 font-medium">{name}</td>
                    <td className="py-2 px-4 text-gray-700">{specialties}</td>
                  </tr>
                );
              })}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default DoctorList;
